    "tropical-cyclone-segments-occurring-within-the-eastern-pacific-and-north-atlantic-oce-1900-2013",nt"isopen":
    false,nt"url": null,nt"notes": "These data represent a unique subset of
    the International Best Track Archive for Climate Stewardship (IBTrACS) data set.
    Features represent IBTrACS storm track segments that 1) are attributed to the North
    Atlantic or Eastern Pacific basins; 2) do not cross the International Date Line;
    3) occur in or after 1900; 4) have maximum wind values above 33 knots; and 5) are
    attributed as extratropical, subtropical, or tropical. Furthermore, those storm
    segments that were attributed as tropical within the source data were modified to
    the appropriate storm category based on the maximum wind speed value per segment.",nt"license_title":
